import React from 'react';
import Booking1 from '../components/Booking1';
import Hero from '../components/Hero';
import Process from '../components/Process';

function Booking(props) {
    return (
        <div>
            <Hero />
            <Process />
            <Booking1 />
        </div>
    );
}

export default Booking;
